import './App.css';
import LoginForm from './Components/LoginForm';
import Landing from './Components/Landing';
import {Routes,Route} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Landing/>
    <Routes>
    <Route path="/"  element={<Landing/>} />
    <Route path='/login'  element={<LoginForm/>} />
    </Routes>  
    </div>
  );
}

export default App;
